import React, { Component } from 'react'




class Student extends Component {
    constructor(props){
        super(props);
        this.state = {
            name:'Lathesh',
            roll:this.props.roll
        };
    }
   
    render(){
        return (
            div
        )
    }
 
}

export default Student;
